#include <iostream>
#include <vector>
#include <valarray>

using namespace std;

class Solution {
public:
    int numSubarrayProductLessThanK(vector<int>& nums, int k) {
        int res = 0;
        int sum = 1;
        for (int i = 0; i < nums.size(); i++) {
            int start = 0;
            int end = i;
            sum = 1;
            int startRes = res;
            for (int j = start; j <= end; j++) {
                sum *= nums[j];
            }
            if (sum < k) {
                res++;
            }
            for (;end + 1 < nums.size();) {
                sum /= nums[start++];
                sum *= nums[++end];
                if (sum < k) {
                    res++;
                }
            }
            if (startRes == res) {
                break;
            }
        }
        return res;
    }
};

